### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. **Differentiability and Continuity**
- **Concepts:** Differentiability at a point, continuity, limits.
- **Principles:** A function is differentiable at a point if it has a derivative at that point. Continuity is a necessary condition for differentiability.
- **Equations:**
  - Differentiability condition: \( f'(a) \) exists.
  - Continuity condition: \( \lim_{x \to a} f(x) = f(a) \).

#### 2. **Limits**
- **Concepts:** Limits at infinity, limits at a point, L'Hôpital's Rule.
- **Principles:** Limits help understand the behavior of functions as they approach certain points or infinity.
- **Equations:**
  - Basic limit: \( \lim_{x \to a} f(x) = L \).
  - L'Hôpital's Rule: If \( \lim_{x \to a} \frac{f(x)}{g(x)} \) is of the form \( \frac{0}{0} \) or \( \frac{\infty}{\infty} \), then \( \lim_{x \to a} \frac{f(x)}{g(x)} = \lim_{x \to a} \frac{f'(x)}{g'(x)} \).

#### 3. **Functions and Their Properties**
- **Concepts:** One-to-one functions, continuous functions, differentiable functions.
- **Principles:** Understanding the properties of functions helps in analyzing their behavior and solving related problems.
- **Equations:**
  - One-to-one function: \( f(a) = f(b) \) implies \( a = b \).
  - Continuity: \( \lim_{x \to a} f(x) = f(a) \).

#### 4. **Sequences and Their Limits**
- **Concepts:** Sequences, limits of sequences.
- **Principles:** Sequences are ordered lists of numbers, and their limits describe the behavior as the index approaches infinity.
- **Equations:**
  - Limit of a sequence: \( \lim_{n \to \infty} a_n = L \).

#### 5. **Exponential and Logarithmic Functions**
- **Concepts:** Exponential functions, logarithmic functions, solving exponential and logarithmic equations.
- **Principles:** These functions are inverses of each other and have unique properties useful in various applications.
- **Equations:**
  - Exponential function: \( y = e^x \).
  - Logarithmic function: \( y = \log_b(x) \).
  - Change of base formula: \( \log_b(a) = \frac{\log_k(a)}{\log_k(b)} \).

#### 6. **Composite Functions**
- **Concepts:** Composition of functions, domain of composite functions.
- **Principles:** Composite functions involve applying one function to the result of another.
- **Equations:**
  - Composite function: \( (g \circ f)(x) = g(f(x)) \).

#### 7. **Domain and Range**
- **Concepts:** Domain of a function, range of a function.
- **Principles:** The domain is the set of input values for which the function is defined, and the range is the set of output values.
- **Equations:**
  - Domain: \( \{ x \mid f(x) \text{ is defined} \} \).
  - Range: \( \{ f(x) \mid x \in \text{domain} \} \).

